window.bookSummaryJSON = "<p><b>The path from retail middle management to inter-dimensional wizard adventurer wasn’t easy. </b></p> <p>But Jason Asano is settling into his new life. Now, a contest draws young elites to the city of&nbsp;Greenstone to compete for a grand prize. Jason must gather a band of companions if he is to stand a chance against the best the world has to offer.&nbsp;</p> <p>While the young adventurers are caught up in competition, the city leaders deal with revelations of betrayal as a vast and terrible enemy is revealed. Although Jason seems uninvolved, he has unknowingly crossed the enemy’s path before. Friends and foes made along the way will lead him to cross it again. Inevitable conflict looms....</p>"; 
